prompt Creating ACADEMIC_INSTITUTION...
create table ACADEMIC_INSTITUTION
(
  institutionid NUMBER(10) not null,
  name          VARCHAR2(30),
  kind          VARCHAR2(30),
  numofstudents NUMBER(4),
  numofteachers NUMBER(3),
  address       VARCHAR2(30)
)
;
alter table ACADEMIC_INSTITUTION
  add primary key (INSTITUTIONID)
  ;
alter table ACADEMIC_INSTITUTION
  add constraint CHK_NUMOFSTUDENTS
  check (numOfStudents >= 0);

prompt Creating TAX_ACCOUNT...
create table TAX_ACCOUNT
(
  tax_id     NUMBER(15) not null,
  tax_price  NUMBER(15) not null,
  tax_create DATE not null,
  tax_close  DATE
)
;
alter table TAX_ACCOUNT
  add primary key (TAX_ID)
  ;

prompt Creating ASSET...
create table ASSET
(
  asset_id       NUMBER(15) not null,
  asset_address  VARCHAR2(30) not null,
  asset_type     VARCHAR2(20) not null,
  asset_area     NUMBER(20) not null,
  asset_purchase DATE not null,
  asset_change   DATE,
  tax_id         NUMBER(15) not null,
  bonus          NUMBER(20)
)
;
alter table ASSET
  add primary key (ASSET_ID)
  ;
alter table ASSET
  add foreign key (TAX_ID)
  references TAX_ACCOUNT (TAX_ID);

prompt Creating DEBT...
create table DEBT
(
  debt_id        NUMBER(15) not null,
  debt_price     NUMBER(15) not null,
  debt_create    DATE not null,
  debt_last_date DATE not null,
  tax_id         NUMBER(15) not null
)
;
alter table DEBT
  add primary key (DEBT_ID, TAX_ID)
  ;
alter table DEBT
  add foreign key (TAX_ID)
  references TAX_ACCOUNT (TAX_ID);

prompt Creating RESIDENT...
create table RESIDENT
(
  resident_id      NUMBER(9) not null,
  resident_fname   VARCHAR2(16) not null,
  resident_lname   VARCHAR2(16) not null,
  resident_birth   DATE not null,
  resident_address VARCHAR2(30) not null,
  resident_phone   NUMBER(10) not null,
  resident_joining DATE not null
)
;
alter table RESIDENT
  add primary key (RESIDENT_ID)
  ;

prompt Creating DISCOUNT...
create table DISCOUNT
(
  discount_id      NUMBER(15) not null,
  discount_percent NUMBER(10) not null,
  discount_type    VARCHAR2(80) not null,
  discount_start   DATE not null,
  discount_end     DATE not null,
  resident_id      NUMBER(9) not null
)
;
alter table DISCOUNT
  add primary key (DISCOUNT_ID)
  ;
alter table DISCOUNT
  add foreign key (RESIDENT_ID)
  references RESIDENT (RESIDENT_ID);

prompt Creating OWNERSHIP...
create table OWNERSHIP
(
  asset_id    NUMBER(15) not null,
  resident_id NUMBER(9) not null
)
;
alter table OWNERSHIP
  add primary key (ASSET_ID, RESIDENT_ID)
  ;
alter table OWNERSHIP
  add foreign key (ASSET_ID)
  references ASSET (ASSET_ID);
alter table OWNERSHIP
  add foreign key (RESIDENT_ID)
  references RESIDENT (RESIDENT_ID);

prompt Creating TEACHER...
create table TEACHER
(
  id          NUMBER(9) not null,
  proffassion VARCHAR2(30),
  seniority   NUMBER(3),
  gender      VARCHAR2(1),
  phone       NUMBER(10),
  freeday     NUMBER(1)
)
;
alter table TEACHER
  add primary key (ID)
  ;
alter table TEACHER
  add foreign key (ID)
  references RESIDENT (RESIDENT_ID);
alter table TEACHER
  add constraint CHK_SENIORITY
  check (seniority >= 0);

prompt Creating TRAINING...
create table TRAINING
(
  trainingid    NUMBER(10) not null,
  location      VARCHAR2(30),
  training_date DATE,
  name          VARCHAR2(30)
)
;
alter table TRAINING
  add primary key (TRAININGID)
  ;

prompt Creating PARTICIPANT...
create table PARTICIPANT
(
  id         NUMBER(9) not null,
  trainingid NUMBER(10) not null
)
;
alter table PARTICIPANT
  add primary key (ID, TRAININGID)
  ;
alter table PARTICIPANT
  add foreign key (ID)
  references TEACHER (ID);
alter table PARTICIPANT
  add foreign key (TRAININGID)
  references TRAINING (TRAININGID);

prompt Creating PAYMENT...
create table PAYMENT
(
  payment_id      NUMBER(15) not null,
  payment_amount  NUMBER(15) not null,
  payment_type    VARCHAR2(20) not null,
  payment_date    DATE not null,
  payment_receipt DATE not null,
  tax_id          NUMBER(15) not null
)
;
alter table PAYMENT
  add primary key (PAYMENT_ID, TAX_ID)
  ;
alter table PAYMENT
  add foreign key (TAX_ID)
  references TAX_ACCOUNT (TAX_ID);

prompt Creating PRINCIPAL...
create table PRINCIPAL
(
  principal_id   NUMBER not null,
  resident_id    NUMBER,
  institution_id NUMBER
)
;
alter table PRINCIPAL
  add primary key (PRINCIPAL_ID)
  ;
alter table PRINCIPAL
  add foreign key (RESIDENT_ID)
  references RESIDENT (RESIDENT_ID);
alter table PRINCIPAL
  add foreign key (INSTITUTION_ID)
  references ACADEMIC_INSTITUTION (INSTITUTIONID);

prompt Creating PUPIL...
create table PUPIL
(
  id            NUMBER(9) not null,
  firstname     VARCHAR2(20),
  lastname      VARCHAR2(20),
  birthdate     DATE,
  homeclass     VARCHAR2(4),
  gender        VARCHAR2(1) default 'M',
  parentphone   NUMBER(10),
  institutionid NUMBER(10),
  allergics     VARCHAR2(30)
)
;
alter table PUPIL
  add primary key (ID)
  ;
alter table PUPIL
  add foreign key (INSTITUTIONID)
  references ACADEMIC_INSTITUTION (INSTITUTIONID);

prompt Creating STUDENTCOUNCIL...
create table STUDENTCOUNCIL
(
  year      NUMBER(4) not null,
  head      VARCHAR2(40) not null,
  assistant VARCHAR2(40)
)
;
alter table STUDENTCOUNCIL
  add primary key (YEAR)
 ;

prompt Creating REPRESENTIVE...
create table REPRESENTIVE
(
  id      NUMBER(9) not null,
  role    VARCHAR2(15),
  age     NUMBER(2),
  average NUMBER(3),
  year    NUMBER(4)
)
;
alter table REPRESENTIVE
  add primary key (ID)
  ;
alter table REPRESENTIVE
  add foreign key (YEAR)
  references STUDENTCOUNCIL (YEAR);
alter table REPRESENTIVE
  add foreign key (ID)
  references PUPIL (ID);

